import "./style.css";
import { useNavigate } from "react-router-dom";
export default function Login() {
    const navigate=useNavigate()
    const [userInfo,setUserInfo]=useState({
        email:'',
        password:''
    })
    const handleonchange=(e)=>{
        const {name,value}=e.target
        setUserInfo((prestate)=>({
            ...prestate,
            [name]:value
        }))
    }

    const handlesignin=()=>{
        console.log('masum')
        // if(userInfo.email && userInfo.password){
            localStorage.setItem('email', userInfo.email);
            navigate('./home')
        // }
    }
  return (
    <div className="main--contaner">
      <section>
        <div className="left">
          <h1>Get Started</h1>
          <input type="email" placeholder="User name" onChange={handleonchange} />
          <input type="password" placeholder="Password" onChange={handleonchange}/>
          <button onClick={handlesignin} dis>Sign In</button>
        </div>
      </section>
      <section>
          <div className="right">
            <h1>Code Galaxy</h1>
            <img
              src="https://www.codegalaxy.co.in/uploads/2437f-logosmall.png"
